      <div className='App'>
          <Ts1 nom={personne1.nom} age={personne1.age}/>
          <Ts1 nom={personne2.nom} age={personne2.age}/>
          <Ts1 nom={personne3.nom} age={personne3.age}/>
      </div>
    
    )
  }
}
